import { defineComponent,computed } from "vue";

export default defineComponent({
  name:'jie-header',
  props: {
    //标题文字
    title: {
      type: String,
    },
    //是否显示查看更多，本大屏界面暂时用不到
    showMore: {
      type: Boolean,
      default: false,
    },
    //是否显示返回按钮，本大屏界面暂时用不到
    showBack: {
      type: Boolean,
      default: false,
    },
  },
  setup(props: any, {emit }) {
    const curTitle =computed(()=>{return props.title});
    //查看更多
    const onLookMore = () => {
      emit("onLookMore");
    };
    //返回
    const onBack = () => {
      emit("onBack");
    };
    return { onLookMore, onBack,curTitle };
  },
});
